import { Component } from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import Signup from './routes/Signup'
class App extends Component {
  render() {
    return (
      <div className='App'>
         <Routes>
        <Route path = "/final" element = {<Signup/>}></Route>
        
       </Routes>
       

      </div>
      
    );
  }
}
export default App;
